import 'bootstrap/dist/css/bootstrap.min.css';
import Catelog from './components/Catelog';
import { Route, Link, Router } from 'react-router-dom';
import Tesla from './Tesla/Model_S/main';
import { Tab } from 'react-bootstrap';
import Home from './components/homepage/homepage';
// added new images ;
function App() {
  return (
    <div className="App">
      {/* Sedan SUV Hatchback Convertibles Premium Luxury Off road Sports Popular */}
      <Router   path="/" component={Home} />
      <Router   path="/electric" component={Catelog} />
      <Router   path="/suv" component={Catelog} />
      <Router   path="/hatchback" component={Catelog} />
      <Router   path="/convertibles" component={Catelog} />
      <Router   path="/premium" component={Catelog} />
      <Router   path="/luxury" component={Catelog} />
      <Router   path="/offRoad" component={Catelog} />
      <Router   path="/sports" component={Catelog} />
      <Router   path="/popular" component={Catelog} />
      <Router   path="/sedan" component={Catelog} />
      {/* <Tesla /> */}
    </div>
  );
}

export default App;
